    getArticles(section:String, to?:number){
        if(section === 'recenzije'){
            this.articlesChanged.next(this.rewievsArticles.slice());
            return this.rewievsArticles.slice();
        }else if(section === 'vesti'){
            return this.newsArticles.slice(0, to);
        }else{
            return this.moviesArticles.slice(0, to);
        }
    }

    // ------------------------

    getArticleByTitle(title:String){
        let length:number;
        length = this.moviesArticles.length + this.newsArticles.length + this.rewievsArticles.length;
        for(let i = 0; i < length; i++){
            if(this.moviesArticles[i].title === title){
                return this.moviesArticles[i];
            }else if(this.newsArticles[i].title === title){
                return this.newsArticles[i];
            }else if(this.rewievsArticles[i].title ===title){
                return this.rewievsArticles[i];
            }
        }
    }

    addArticle(newArticle?:Model, section?:String){
        if(section === 'Recenzije'){
            console.log(this.rewievsArticles)
            this.rewievsArticles.unshift(newArticle);
            console.log(this.rewievsArticles);
            // this.articlesChanged.next(this.rewievsArticles.slice());
            this.addArticleToDatabase(this.getArticles('recenzije'));
        }
    }

    addArticleToDatabase(article: Model[]){
        this.http.put('https://evotifilm-75e18.firebaseio.com/rewievs.json', article).
        subscribe(
            response => {
                const data = response.json()
                this.articlesChanged.next(data)
                console.log(data)
            }
        )
    }

    getArticleFromDatabase(){
        return this.http.get('https://evotifilm-75e18.firebaseio.com/rewievs.json').
            map(
                (response:Response) => {
                    const data = response.json()
                    return data
                }
            ).
            subscribe(
                (response:Model[]) => {
                    this.rewievsArticles = response;
                    this.articlesChanged.next(response);                    
                }
            )
    }
